  return (
    <>
      <h1>The Product Page</h1>
      <ul>
        <li>
          <Link to="/">Product 1</Link>
        </li>
        <li>
          <Link>Product 2</Link>
        </li>
        <li>
          <Link>Product 3</Link>
        </li>
      </ul>
    </>
  );
}

export default ProductPage;
